if mibBuilder.loadTexts: hh3cIpa.setDescription(' This MIB is used to acquire ip accounting information. The hh3cIpaAccountListTable is set by user to define the group of ip address which they want to account. This module can be enabled in each port, which was defined in the hh3cIpaIfConfigTable. If this module has been enabled, the packets will be accounted when crossing the router from the ports having been enabled by user, according to whether the source/destination ip address is in hh3cIpaAccountListTable and what kinds of function(in/out/both/fw) are enabled and also whether it is denied by the firewall. If it is denied by the firewall, it will be accounted in hh3cIpaFWListTable If it is accepted by the firewall, and ip source or ip destination is in hh3cIpaAccountListTable, it will be accounted in hh3cIpaIntListTable, otherwise it will be accounted in hh3cIpaExtListTable. And IP Accounting function also differentiates the packets by direction. If the packet is inbound, the accounting information can be seen as hh3cIpaIntListInPackets/hh3cIpaIntListInBytes in hh3cIpaIntListTable, hh3cIpaExtListInPackets/hh3cIpaExtListInBytes in hh3cIpaExtListTable, hh3cIpaFWListInPackets/hh3cIpaFWListInBytes in hh3cIpaFWListTable. or else the accounting information can be seen as hh3cIpaIntListOutPackets/hh3cIpaIntListOutBytes in hh3cIpaIntListTable, hh3cIpaExtListOutPackets/hh3cIpaExtListOutBytes in hh3cIpaExtListTable, hh3cIpaFWListOutPackets/hh3cIpaFWListOutBytes in hh3cIpaFWListTable. ')
